import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';

import Home from './pages/Home/Home';
import Login from './pages/Auth/Login';
import Register from './pages/Auth/Register';
import DashBoard from './pages/Home/AdminBoard';
import { UserProvider } from './context/LoggedUserContext';
import UserNotebooks from './pages/Home/UserNotebooks';

function App(){

  return (

    <Router>
      <UserProvider>
      <Routes>
        <Route path ="/adminBoard" element = {<DashBoard/>} />  
        <Route path ="/" element = {<Home/>} /> 
        <Route path ="/login" element = {<Login/>} />
        <Route path ="/register" element = {<Register/>} />
        <Route path = "/notebooks" element= {<UserNotebooks/>} />
      </Routes>
      </UserProvider>
    </Router>

  );

}


export default App;
